import React from "react"

const Title = () => {
	return (
		<div className="title">
			<h1>Exwid test</h1>
			<h2>Our gallery</h2>
			<p>
				Images will store in firebase, so please don't use personal images :)
			</p>
		</div>
	)
}

export default Title
